// Trang báo cáo tổng hợp
import React from 'react';

export default function Reports() {
  return (
    <div style={{ padding: 32 }}>
      <h2>Báo cáo tổng hợp</h2>
      <p>Chức năng báo cáo sẽ được bổ sung sau (tích hợp dữ liệu từ backend).</p>
    </div>
  );
}
